        require(
            courseScores[courseId].giveScoreSupervisorIdExists[supervisorId] ==
                0,
            unicode"该督导已经评分"
        );
        courseScores[courseId].giveScoreSupervisorIdExists[
            supervisorId
        ] = score;
        courseScores[courseId].supervisorScores.push(score);
    }

    function removeCourseSupervisorScores(
        uint256 courseId,
        uint256[] memory supervisorIds_ 
    ) public {
        for (uint256 i = 0; i < supervisorIds_.length; i++) {
            courseScores[courseId].giveScoreSupervisorIdExists[supervisorIds_[i]] = 0;
        }
        delete courseScores[courseId].supervisorScores;
    }

    function getGiveScoreSupervisorIdExists(
        uint256 courseId,
        uint256 supervisorId
    ) public view returns (uint256) {
        return courseScores[courseId].giveScoreSupervisorIdExists[supervisorId];
    }

    function getCourseSupervisorScores(
        uint256 courseId
    ) public view returns (uint256[] memory) {
        return courseScores[courseId].supervisorScores;
    }

    function addSupervisorId(uint256 supervisorId) public {
        supervisorIds.push(supervisorId);
        supervisorCount++;
    }

    function getSupervisorIds() public view returns (uint256[] memory) {
        return supervisorIds;
    }

    function setSupervisorId(address supervisor, uint256 supervisorId) public {
        addressToSupervisorId[supervisor] = supervisorId;
        supervisors[supervisorId].id = supervisorId;
        supervisors[supervisorId].addr = supervisor;
    }

    function setSupervisorName(
        uint256 supervisorId,
        string calldata _name
    ) public {
        supervisors[supervisorId].name = _name;
    }

    function setSupervisorsCourseScore(
        uint256 supervisorId,
        uint256 courseId,
        uint256 score
    ) public {
        supervisors[supervisorId].courseScores[courseId] = score;
    }

    function settransferCourseNumbers(uint256 _transferCourseNumbers) public {
        transferCourseNumbers = _transferCourseNumbers;
    }

    function settransferCourseStartTime(
        uint256 _transferCourseStartTime
    ) public {
        transferCourseStartTime = _transferCourseStartTime;
    }

    function settransferCourseEndTime(uint256 _transferCourseEndTime) public {
        transferCourseEndTime = _transferCourseEndTime;
    }

    function setScoreType(string calldata option) public {
        ScoreTypeChioce = option;
    }
}
